[[File:Drop table.png|thumb|300px|A player receives loot from a monster's drop table.]]
A '''drop table''' represents a list of [[drops]] that a monster is able to drop. Most monsters have their own drop table that is largely determined by the requirements to reach them, their difficulty to kill and how often they can be killed; for example, most [[slayer boss]]es have a fairly generous drop table as they can only be killed while on the appropriate [[slayer task]].

==Sub-Tables==
While most monsters in ''Old School RuneScape'' have their own drop table, a large majority have several universal sub-tables that are called upon within their main drop table, such as the herb and [[rare drop table]]. However, there are many other drop tables that are shared between various monsters.

Tables included on monster's drop tables show the actual drop rate of the item for that monster. On this page, or any individual sub-table page, are described as the table has already been rolled and does not consider the rarity of any particular monster to hit that sub-table.

For example: On the rare drop table, a sapphire is normally a 1/4 drop chance. In the context of a monster, the rare drop table must be hit first, which in this example has a 1/50 chance, then it must hit the sapphire's 1/4 after that. Bringing the chance of a sapphire to a 1/200 drop rate for that particular monster.

==Pre-roll==
A '''pre-roll''' is a drop table which is rolled before rolling the main drop table. Typically, pre-rolls will go down a list of items in a predetermined order and if no pre-rolled items are hit, the main table is then rolled.

An example of a pre-roll would be loot from a [[supply crate]], in which the player first rolls for a [[dragon axe]]. If that roll fails, then the player will roll for a [[Phoenix]], then a [[tome of fire]], [[warm gloves]], [[bruma torch]] and lastly a piece of the [[pyromancer outfit]] in which the player has the least of (though players will receive the garb, hood, robe and boots in that order if they do not have any pieces of the outfit). Only when the player fails all six rolls will they roll the main supply crate drop table.

Certain monsters are also known to perform a pre-roll, such as [[slayer monster]]s and [[Wilderness boss]]es. For example, [[gargoyle]]s will first roll for a [[dark mystic robe top]], then a [[granite maul]] before rolling the main drop table, while Wilderness bosses will roll for their unique drops before rolling their main drop tables.

==Tertiary drops==
Tertiary drops are drops that are rolled independently of the main drop table; examples include [[pet]]s, [[clue scroll]]s and [[looting bag]]s. Unlike the main drop, multiple tertiary drops can be obtained in a single kill; however, similarly classed items cannot be obtained at the same time: for example, if a [[curved bone]] is obtained as a tertiary drop, it is impossible to also obtain a [[long bone]], but this roll will have no effect on obtaining a [[clue scroll]].

Some monsters also access a set of tertiary drops, such as [[superior slayer monster]]s, who roll a tertiary drop table alongside three rolls on their standard counterpart's drop table.

