===General seed drop table===
If the monster can be found in [[free-to-play]], the roll on the general seed drop table is replaced by 5 [[coins]] when killed on free-to-play worlds.

The general seed drop table is unique because the seeds that are available are dependent on the combat level of monster that has access to this table. The formula to calculate which subtables the player will have access to when rolled for is as follows: <math>CombatCalculation = CombatLevel * 10</math>. A random number between 0 and <math>CombatCalculation</math> is rolled in order to determine which of the sub-tables is accessed.

